import { Link } from "react-router-dom";
import GuestList from "./GuestList";
import Include from "./Include";

function Home(){
    return(
        <div>
            <Link to="/include" element={<Include/>}>Incluir Convidados</Link>
            <Link to="/guests" element={<GuestList/>}>Lista de Convidados</Link>
        </div>        
    )
}

export default Home;
